import { Router, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import ToDos from './components/ToDos';

function App() {
  return (
    <Router>
      <Header />
      <Route path="/" exact component={ToDos} />
    </Router>
  );
}

export default App;
